    useEffect(()=>{
         fetch(`http://localhost:3001/api/empleados/${3}`,{
          method: "GET",
          headers: {
            "access-control-allow-origin" : "*",
            "Content-type": "application/json; charset=UTF-8"
          }})
        .then((resp)=> resp.json())
        .then((data)=>{
            console.log(data)
            setUser(data);
        })
      },[])

        return(
            <div className="container">
                <UserProfile userData={user}/>
            </div>
        )
    }


export default App;
